script: |
  super -f text -I q5761.spq | sort > q5761.out

inputs:
  - name: q5761.spq
    data: |
      SELECT DISTINCT col2 - + 64 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( ( - + 38 ) ) NOT IN ( col1 ) OR - col1 NOT BETWEEN + 28 AND - - col0 * - 91 - + col1 * + 83;
  - name: tab1

outputs:
  - name: q5761.out
    data: |
      -5
      32
      4
